import React from 'react'

function login() {
  return (
    <div>
     <div className="container">
      <div className="row">
        <div className="col-md-5">
          <h1 className="display-4">Welcome Back</h1>
          <p className="lead">Enter your information</p>
        </div>
      </div>
     </div>
    </div>
  );
}

export default login
